import React from 'react'
class Displayin4 extends React.Component {
    render(){
        const { lannisters, starks} = this.props;
        return(
            <div>
                {lannisters.map((character) => {
                    return(
                        <div key ={character.id}>
                            <div>My name {character.name} I am {character.age} I live in {character.address} </div> 
                        </div>
                    );
                })}
            </div> 
        )
    }
}   
export default Displayin4;
